import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center',
    },
    texinput:{
      marginTop:10,
      width: "75%",
      backgroundColor:'#fff',
    }
  });

export {styles}
